import "./App.css";
import Video from "./components/video";
import arr from  "./data/data.js";

function App() {

  return (
    <div className="App">
      {
        arr.map(video =><Video
          key = {video.id}
          title={video.title}
          views={video.views}
          time={video.time}
          channel={video.channel}
          verified = {video.verified}
        ></Video>)
      }

    </div>
  );
}

export default App;
